import React from "react";
import {useEffect} from 'react';
import MaterialTable from 'material-table';
import { useSelector } from "react-redux";
function Table() {
    const { patient } = useSelector((state) => state.patient)
    useEffect(() => {
        console.log("checking patient store:",patient)
        var a = patient
        console.log("//////////////",a)
    });
    //const data = [ {name:"kamalesh",age:24},
    //{name:"magesh",age:24},
    //{name:"nandy",age:21},
    //{name:"vinmeetha",age:28} ]
    const data = patient.map(patient => ({ ...patient}));
    const columns = [
        {
            title:"Name",field:"Firstname + Lastname"
        },
        {
            title:"Last",field:"Lastname"
        }
    ]
    
    return (
      <>
        <h1>table goes here</h1>
        <div style={{width:"50 vw"}}>
            <MaterialTable title="Material Table"
            data={data}
            columns={columns}
            options={{
                paging:false
            }}
            />
        </div>
      </>
    );
  }
  
  export default Table;
